import styled from "styled-components";

const MainBlock = styled.div`
  width: 100vw; // %로 하면 오류가 뜨는데 이유 찾아보기.
  height: 100vh;
  background: #e6e6e6;
`;

function App() {
  return (
    <>
      <MainBlock />
    </>
  );
}

export default App;
